description:
Mr. Julian Sausage is a newcomer to Toronto, Canada from Montreal, Quebec. Rent prices are steep here, and not knowing the competitive market he decides to hire a realtor. Imagine his delight when Denni shows up to their appointment to view a condo in the beautiful and quaint harbourfront community of downtown. Excited about his realtor more than the apartment he is about to see, Mr. Sausage quickly decides that the best course of action is to seduce the young, good looking sales associate. When it comes time to discuss the cost for rent of the new dwelling, Mr. Sausage makes Denni an offer she cannot refuse - his cock.

